#pragma CODE_SECTION(observer, "ramfuncs")
long observer(long command, long phi) {

	phihat[1] = _IQmpy((_IQ(1)-GZ), phihat[0]) + _IQmpy(SAMPLE, what[0]) + _IQmpy(SAMPLE, uhat[0]) + _IQmpy(GZ, phi);
	what[1] = what[0] + _IQmpy(SAMPLE, ahat[0]) + _IQmpy(GV, phi-phihat[0]) + _IQmpy(SAMPLE, command);
	uhat[1] = uhat[0] + _IQmpy(GU, phi-phihat[0]);
	ahat[1] = ahat[0] + _IQmpy(GA, phi-phihat[0]);
//	what[1] = what[0] + _IQmpy(SAMPLE, ahat[0]) - _IQmpy(GV, phihat[0]) + _IQmpy(GV, phi) + _IQmpy(SAMPLE, command);
//	uhat[1] = uhat[0] + _IQmpy(GU, phi) - _IQmpy(GU, phihat[0]);
//	ahat[1] = ahat[0] + _IQmpy(GA, phi) - _IQmpy(GA, phihat[0]);

	phihat[0] = phihat[1];
	what[0] = what[1];
	uhat[0] = uhat[1];
	ahat[0] = ahat[1];

	return phihat[1];
}

#pragma CODE_SECTION(phase2freq, "ramfuncs")
long phase2freq(long phase, long oldphase) {
	long dP;
	dP = phase - oldphase;

	if(dP > _IQ(3))
		dP = dP - TWOPI;
	else if(dP < _IQ(-3))
		dP = dP + TWOPI;

	return _IQmpy(dP, SAMPLER);
}

#pragma CODE_SECTION(cyclecounter, "ramfuncs")
long cyclecounter(long phase, long ophase) {
	if(phase-ophase < _IQ(-3))
		return 1;
//		return _IQ(1);
	else if(phase-ophase > _IQ(3))
		return -1;
//		return _IQ(-1);
//	return _IQ(0);
	return 0;
}

#pragma CODE_SECTION(Filter, "ramfuncs")
void Filter(void) {
	long b = _IQ(0.00313175395836);			// Fp=100, Ts=5e-6, a = 1/(2*pi*Fp*Ts+1), b=1-a
//	long b = _IQ(0.03045902795142);			// Fp=1000, Ts=5e-6, a = 1/(2*pi*Fp*Ts+1), b=1-a

	integ[0] = integ[0] + _IQmpy(b, (fDf - integ[0]));
	integ[1] = integ[1] + _IQmpy(b, (integ[0] - integ[1]));
	integ[2] = integ[2] + _IQmpy(b, (integ[1] - integ[2]));
	integ[3] = integ[3] + _IQmpy(b, (integ[2] - integ[3]));
	integ[4] = integ[4] + _IQmpy(b, (integ[3] - integ[4]));
	integ[5] = integ[5] + _IQmpy(b, (integ[4] - integ[5]));

	integ[6] = integ[6] + _IQmpy(b, (fQf - integ[6]));
	integ[7] = integ[7] + _IQmpy(b, (integ[6] - integ[7]));
	integ[8] = integ[8] + _IQmpy(b, (integ[7] - integ[8]));
	integ[9] = integ[9] + _IQmpy(b, (integ[8] - integ[9]));
	integ[10] = integ[10] + _IQmpy(b, (integ[9] - integ[10]));
	integ[11] = integ[11] + _IQmpy(b, (integ[10] - integ[11]));

	integ[12] = integ[12] + _IQmpy(b, (fDb - integ[12]));
	integ[13] = integ[13] + _IQmpy(b, (integ[12] - integ[13]));
	integ[14] = integ[14] + _IQmpy(b, (integ[13] - integ[14]));
	integ[15] = integ[15] + _IQmpy(b, (integ[14] - integ[15]));
	integ[16] = integ[16] + _IQmpy(b, (integ[15] - integ[16]));
	integ[17] = integ[17] + _IQmpy(b, (integ[16] - integ[17]));

	integ[18] = integ[18] + _IQmpy(b, (fQb - integ[18]));
	integ[19] = integ[19] + _IQmpy(b, (integ[18] - integ[19]));
	integ[20] = integ[20] + _IQmpy(b, (integ[19] - integ[20]));
	integ[21] = integ[21] + _IQmpy(b, (integ[20] - integ[21]));
	integ[22] = integ[22] + _IQmpy(b, (integ[21] - integ[22]));
	integ[23] = integ[23] + _IQmpy(b, (integ[22] - integ[23]));
}

#pragma CODE_SECTION(SlowFilter, "ramfuncs")
void SlowFilter(void) {
	long b = _IQ(0.23905722361069);

	integ[24] = integ[24] + _IQmpy(b, (freqf - integ[24]));
	integ[25] = integ[25] + _IQmpy(b, (integ[24] - integ[25]));
	integ[26] = integ[26] + _IQmpy(b, (integ[25] - integ[26]));
	integ[27] = integ[27] + _IQmpy(b, (integ[26] - integ[27]));
	integ[28] = integ[28] + _IQmpy(b, (integ[27] - integ[28]));
	integ[29] = integ[29] + _IQmpy(b, (integ[28] - integ[29]));

	integ[30] = integ[30] + _IQmpy(b, (freqb - integ[30]));
	integ[31] = integ[31] + _IQmpy(b, (integ[30] - integ[31]));
	integ[32] = integ[32] + _IQmpy(b, (integ[31] - integ[32]));
	integ[33] = integ[33] + _IQmpy(b, (integ[32] - integ[33]));
	integ[34] = integ[34] + _IQmpy(b, (integ[33] - integ[34]));
	integ[35] = integ[35] + _IQmpy(b, (integ[34] - integ[35]));

}

long sine, cosine;

#pragma CODE_SECTION(abc2dq, "ramfuncs")
void abc2dq(void) {

	long sresult;
	long cresult;

	long fAlpha, fBeta;

	sresult = _IQsin(detectphase);
	cresult = _IQcos(detectphase);	

	sine = sresult;
	cosine = cresult;

	fAlpha = _IQmpy(((fA<<1) - fB - fC), ONETHIRD);
	fBeta = _IQmpy((fB - fC), ISQRT3);

	fDf = _IQmpy(sresult, fAlpha) - _IQmpy(cresult, fBeta);
	fQf = _IQmpy(cresult, fAlpha) + _IQmpy(sresult, fBeta);

	fDb = -(_IQmpy(sresult, fAlpha)) - _IQmpy(cresult, fBeta);
	fQb = _IQmpy(cresult, fAlpha) - _IQmpy(sresult, fBeta);


}

